import "./App.css";
import api from "./services/api";
import Games from "./model/games.model";

const fetchGames = async () => {
  try {
    const data = await api.games.getGames();
    return data.games;
  } catch (error) {
    console.log("ERROR", error);
  } finally {
    console.log("FINALLY");
  }
};

const App = async () => {
  const games = await fetchGames();

  return (
    <div className="App">
      {" "}
      {Promise.all(
        games.map(async (game) => {
          <h2 key={game.id}>{game.developer}</h2>;
          console.log(game.developer);
          console.log(game.genre);
        })
      )}
    </div>
  );
};

export default App;
